import React, { Component } from "react";
import "../style/typing.css";
import Typist from 'react-typist';


class Landing extends Component {
  render() {
    const style = { textAlign: "center", fontSize: '5em', marginTop: '50px' };
    return (
      <div className="landing">
        <div style={style}>Welcom to Musicly</div>
        <Typist className="typist">
        <Typist.Delay ms={2500} />
          Hello my friend.<br/>
        <Typist.Delay ms={500} />
          This site is going to help you improve your musical hearing.<br/>
          Sign up for free and let's begin practice!
        </Typist>
      </div>
    );
  }
}

export default Landing;
